        if self.__flipCard == True:
            self.__flipCard = False
            return False
        if self.__flipCard == False:
            self.__flipCard = True
            return True

    def isFlipped(self):
        if self.__flipCard == True:
            return True

    def displayCard(self):
        if self.__flipCard == True:
            return str(chr(self.getValue()))
        else:
            return str(" ")

    def __str__(self):
        return self.displayCard()

